class Routes {
  Routes({
      Bounds? bounds, 
      List<Legs>? legs, }){
    _bounds = bounds;
    _legs = legs;
}

  Routes.fromJson(dynamic json) {
    _bounds = json['bounds'] != null ? Bounds.fromJson(json['bounds']) : null;
    if (json['legs'] != null) {
      _legs = [];
      json['legs'].forEach((v) {
        _legs?.add(Legs.fromJson(v));
      });
    }


  }
  Bounds? _bounds;
  List<Legs>? _legs;

Routes copyWith({  Bounds? bounds,
  List<Legs>? legs,
}) => Routes(  bounds: bounds ?? _bounds,
  legs: legs ?? _legs,
);

  Bounds? get bounds => _bounds;
  List<Legs>? get legs => _legs;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_bounds != null) {
      map['bounds'] = _bounds?.toJson();
    }
    if (_legs != null) {
      map['legs'] = _legs?.map((v) => v.toJson()).toList();
    }

    return map;
  }

}



